import './App.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Head from "./com/Head"
import Home from './com/Home';
import About from "./com/About"
import Foot from "."

function App() {
  return (
    <Router>
      <Head/>
      <Routes>
        <Route path="/" element={<Home/>} />
        <Route path="/about" element={<About/>} />
      </Routes>
      <Foot/>
    </Router>
  );
}

export default App;
